script: |
  super -f text -I q3698.spq | sort > q3698.out

inputs:
  - name: q3698.spq
    data: |
      SELECT + - col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL BETWEEN ( + ( - - col0 ) * 60 * ( + col0 ) ) AND + ( + ( + col2 ) ) * - ( - col2 ) + - 27;
  - name: tab0

outputs:
  - name: q3698.out
    data: |
